import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be rendered by JavaScript.
    // Using a specific selector for a product card within the featured grid.
    const productCardSelector = '#productsGrid .product-card';
    await page.waitForSelector(productCardSelector, { timeout: 10000 });

    // Take a screenshot after products have loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Click the first product card to trigger the modal
    const firstProductCard = page.locator(productCardSelector).first();
    await firstProductCard.click();

    // Wait for the modal to become visible. The modal has an ID of 'productModal'.
    const modalSelector = '#productModal';
    await page.waitForSelector(modalSelector, { state: 'visible', timeout: 5000 });

    // Take a screenshot of the visible modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract data from the modal to confirm it opened correctly
    const modal = page.locator(modalSelector);
    const modalTitle = await modal.locator('.product-detail-title').textContent();
    const isModalVisible = await modal.isVisible();

    if (!isModalVisible) {
      throw new Error('Product detail modal did not appear as expected.');
    }

    return {
      success: true,
      action: "Opened the product detail modal by clicking the first featured product.",
      extractedData: {
        modalTitle: modalTitle.trim(),
        isModalVisible: isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
